// NavigationButtons.js
import React from 'react';
import { Link } from 'react-router-dom';
import './app.css'; // Make sure this path is correct based on your project structure

 NavigationButton = () => {
  return (
    <div className="button-container">
      <Link to="/inventory">
        <button className="btn">Inventory Manager</button>
      </Link>
      <Link to="/invoice">
        <button className="btn">Invoice Generator</button>
      </Link>
      <Link to="/expense">
        <button className="btn">Expense Tracker</button>
      </Link>
      <Link to="/payment">
        <button className="btn">Payment Gateway</button>
      </Link>
    </div>
  );
};

export default NavigationButtons;
